import Dau from "./Dau";
import Banner from "./Banner";
import LoaiSP from "./Loai_San_Pham";
import HeaderLoai from "./headerLoai";
import footer1 from "./footer";
const Member=[
    {
      IMGSP: "anh_1.jpg",
      NameSP: "SP thu 1",
      PriceSP: 50000,
    }];
  
  for (let i=1;i<8;i++){
    Member[i]={IMGSP: "anh_1.jpg",
    NameSP: "SP thu "+i,
    PriceSP: 50000,}
  }
  

function ChungH()
{
    const listMember= Member.map(function(item){
        return (
          <LoaiSP member={item}/>
      );
      });
    return(
    <>
    <Dau/>
    <Banner/>
    <HeaderLoai/>
    <div class='row'> {listMember}</div>
    <footer1/>
</>
    )
}

export default ChungH;
